import React from "react";
import '../css/Home.css';
import profile from '../images/profile.png';
import shape from '../images/shape.png';
import Statusbar from '../images/Statusbar.png';
import clock from '../images/clock.jpg';
import rect from '../images/rect.png';
import rect1 from '../images/rect1.png';
import rect2 from '../images/rect2.png';
function Home() {
  return (
      <><div>
      <meta charSet="UTF-8" />
      <meta httpEquiv="X-UA-Compatible" content="IE=edge" />
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <title>Home</title>
      <div className="container">
      <img className="img0" src={shape} alt='shape' />
      <img className="img4" src={rect} alt='rect' />
      <img className="img1" src={Statusbar} alt='status' />
     <div>
    <img id="img2" src={profile} alt='pic' />
    </div> 
    <img className="img3" src={clock} alt='clock' />
    <form>
        <p className="ts1">Tasks List</p>
        
        <img className="img5" src={rect1} alt='rect1' />
        <h6>Daily tasks</h6>
        <img className="img6" src={rect2} alt='rect2' />
      </form>
      </div>
      </div></>
     );
  }
  export default Home;
